import { useState } from 'react';
import { Button } from 'antd';

function UseMemo() {
  const [val, setVal] = useState(0);
  const change = () => {
    setVal(Math.round(Math.random() * 10));
  }
  return (
    <div className='text-center'>
      <h1>{val}</h1>
      <Button onClick={change}>Change</Button>
    </div>
  );
}
export default UseMemo;
